import React, { useState, useEffect, createContext } from 'react';
import OpenOrders from '../pages/OpenOrders';
import OrderTables from '../pages/OrderTables';

export const ProductContext = createContext();

export default function MainRouter() {
  const [products, setProducts] = useState([]);
  const [checkout, setCheckout] = useState([]);

  useEffect(() => {
    const storeProducts = JSON.parse(localStorage.getItem('storeProducts'));
    if (storeProducts) setProducts(storeProducts);
  }, []);

  useEffect(() => {
    localStorage.setItem('storeProducts', JSON.stringify(products));
  }, [products]);

  const onClickButton = () => {
    setCheckout(products);
  };

  return (
    <div className="main-component">
      <ProductContext.Provider value={[products, setProducts, onClick]}>
        <OpenOrders />
        <OrderTables />
      </ProductContext.Provider>
    </div>
  );
}
